import React, { Component } from 'react';
import './inc.css';



class inc extends Component {

  constructor(props) {
    super(props);
    this.x1inc = this.x1inc.bind(this);
  }
  x1inc() {
    var x = document.getElementsByClassName("inc");
    var i; for (i = 0; i < x.length; i++)
    { x[i].setAttribute("style", "display: none"); };
  }

  render() {
    return (
      <div className="inc">

        <div class="inc-box">
          <a class="no-dec" href="http://www.ivypro.com" target="_new">
          <div class="brand-box">
          <font class="ivypro-text">IVYPRO</font><font class="eng-text">Engineering</font>
        </div></a>
          <div class="x-inc" onClick={this.x1inc}> <i class="fas fa-times"></i> </div>

          <button class="none" onClick={()=>{ test(); }}>Jquery Tester (X)</button>
        </div>


      </div>
    );
  }
}

export default inc;
